import React from "react";
import '../style/profile.css';
import {Person} from '@material-ui/icons/';

export function Profile(){
    return(
        <section className="profile">
            <div className="profile-logo">
                <Person className="profile-logo-picture"/>
                <h2>Name</h2>
            </div>
        </section>
    );
}
